import React from "react";
import "./App.css";
//Import Components
import QuestionList from "./scenes/QuestionList/QuestionList";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

const mockQuestions = [
  {
    _id: "5feb6904f827835ed827ddeb",
    name: "Who am I?",
    email: "who@sky.world",
    date: "2020-12-31T00:00:00.000Z",
    observations: "Who knows.",
    creationDate: "2020-12-29T17:36:04.933Z",
    __v: 0,
  },
  {
    _id: "5feb6904f827835ed827ddeb",
    name: "Who am I?",
    email: "who@sky.world",
    date: "2020-12-31T00:00:00.000Z",
    observations: "Who knows.",
    creationDate: "2020-12-29T17:36:04.933Z",
    __v: 0,
  },
];

const App = () => {
  return (
    <div>
      <div className="home-header">
        <h1>Home</h1>
      </div>
      <div className="content">
        <Router>
          <Switch>
            <Route exact path="/">
              <QuestionList />
            </Route>
            <Route path="/questions">I want to submit a question!!</Route>
          </Switch>
        </Router>
      </div>
      <div>
        <Link to="/questions">
          <button type="button">Submit Question</button>
        </Link>
      </div>
    </div>
  );
};

export default App;
